INSERT INTO `news` VALUES (1,'Meat247 Technology Improving The Red Meat Value Chain – Tech','It is common knowledge now that the red meat value chain in Nigeria needs total over-hauling. From animal production, transportation, processing and storage, to distribtuion and consumption.','https://livestock247.com/blog/2021/05/20/meat247-technology-improving-the-red-meat-value-chain/'),(2,'Bring Banking Service To Rural Livestock Market','When we launched Livestock247.com (Nigeria’s 1st Online Livestock Platform) in 2018, we knew that technology had a role to play in solving the many challenges in the ecosystem. One that stood out was the issue of cash transactions','https://intelnews.com.ng/2021/06/10/bringing-banking-services-to-rural-livestock-markets-ibrahim-maigari-ahmadu/'),(3,'Livestock Mainstreaming Will Solve Farmers, Herders Clash – Data Analyst','A Data analyst and agropreneur, has advocated for the mainstreaming of livestock farming as the solution to the perennial farmers and herders clash which has claimed human lives, livestock, farms and properties.','https://businessday.ng/enterpreneur/article/meet-nigerian-entrepreneur-revolutionising-livestock-industry/'),(4,'USAID/Mercy Corps partner Livestock247.com','USAID-funded Feed the Future Nigeria Rural Resilience activity, through Mercy Corps Nigeria, has signed partnership agreement with Livestock247.com and 13 other private sectors and civil society organisations to facilitate the recovery of Northeast Nigeria business environment.','https://abiodunborisade.com/usaid-mercy-corps-partners-livestock247-com/'),(5,'Meat247 Technology Improving The Red Meat Value Chain – Tech Cabal','It is common knowledge now that the red meat value chain in Nigeria needs total over-hauling. From animal production, transportation, processing and storage, to distribtuion and consumption.','https://livestock247.com/blog/2021/05/20/meat247-technology-improving-the-red-meat-value-chain/');
